# logic: have a temp count of the first one and loo for better one
def findMaxConsecutiveOnes( nums):
    maximum=0
    temp=0
    len_nums=len(nums)
    # if sum(i==1 for i in nums) == len_nums:
    #     return len_nums
    for i in range(len_nums):
        if nums[i]==1:
            temp+=1
            if i == len_nums-1 and temp > maximum:
                maximum = temp
        else:
            # if temp > maximum:
            #     maximum = temp
            #     temp=0
            maximum = max(maximum, temp)
            temp=0
    return maximum

